import React from 'react';
import './App.css';

function About() {
  return (
    <section className="about-section">
      <h2>About Us</h2>
      <p>
        We are a passionate club event promotion company dedicated to creating unforgettable nightlife experiences. Our team brings together the best DJs, artists, and venues to ensure every event is a night to remember. Whether you're a partygoer or a venue owner, we bring energy, creativity, and professionalism to every occasion.
      </p>
      <ul className="about-highlights">
        <li>Expert event curation</li>
        <li>Strong industry connections</li>
        <li>Innovative marketing strategies</li>
        <li>Focus on safety and guest experience</li>
      </ul>
    </section>
  );
}

export default About;
